import SignForm from './SignForm';
import { Link } from 'react-router-dom';

export default function Login() {
  return (
    <SignForm title='Sign in' buttonText='Sign up'>
      <Link className='sign-form__link' to='/login'>
        Already a member? Log in here!
      </Link>
    </SignForm>
  );
}
